import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import {Project} from './routes/Project';

function App() {
  return (
    <div className="App" id='dynamic-root'>
      {/* <Searchbar /> */}
      <BrowserRouter>
        <Routes>
          <Route path='/'/>
          <Route path='/project' element={<Project/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
